import React from 'react';
import logo from '../logo.svg';

function Body(props) {
    return(
        <div>
            <img src={logo} className="App-logo" alt="logo" /> <br/>
            <h1> {props.name} </h1> <br/>
            <h3> {props.mobile} </h3>
            <button className="btn btn-primary">On</button>
        </div>
    );
}

export default Body;
